PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "providers" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "operatingsystems" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "geos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "city" varchar(255), "continent" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "servicetypes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "stype" varchar(255), "contract_day" integer, "isstable" boolean, "isflexiblefee" boolean, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "resourcesets" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "provider_id" integer, "name" varchar(255), "cpu" float, "ram" float, "hdd" float, "iscustomizable" boolean, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "ratesets" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "resourceset_id" integer, "servicetype_id" integer, "operatingsystem_id" integer, "geo_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "rates" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "rateset_id" integer, "item" varchar(255), "period_hour" integer, "rate" float, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "images" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "provider_id" integer, "operatingsystem_id" integer, "imgid" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_resourcesets_on_provider_id" ON "resourcesets" ("provider_id");
CREATE INDEX "index_ratesets_on_resourceset_id" ON "ratesets" ("resourceset_id");
CREATE INDEX "index_ratesets_on_servicetype_id" ON "ratesets" ("servicetype_id");
CREATE INDEX "index_ratesets_on_operatingsystem_id" ON "ratesets" ("operatingsystem_id");
CREATE INDEX "index_ratesets_on_geo_id" ON "ratesets" ("geo_id");
CREATE INDEX "index_rates_on_rateset_id" ON "rates" ("rateset_id");
CREATE INDEX "index_images_on_provider_id" ON "images" ("provider_id");
CREATE INDEX "index_images_on_operatingsystem_id" ON "images" ("operatingsystem_id");
COMMIT;
